import axios from 'axios';
import React, { useState } from 'react';

export async function FetchData(){

    const url = "http://127.0.0.1:8000/api/stock_manager/";

    axios.get(url)
        .then(res =>{
            const response = res.data;
            return response
        })
        .catch(err => console.log(err))     
    
}
